    false,nt"url": null,nt"notes": "Refuge-based Objectives: Use piscivorous
    waterbird monitoring to assess aquatic health of Malheur Lake. How do piscivorous
    waterbirds respond to a transition away from a carp-dominated lake?Nesting on Malheur/Mud
    Lake by Caspian terns, double-crested cormorants, American white pelicans: identify
    nesting locations, potentially suitable nesting habitat (i.e. suitably isolated
    islands). Quantify colony size (at least number of individuals present, nest counts
    if possible; possibly Sod House Ranch cormorant colony). Prioritize incubation period
    flight to allow better assessment of peak colony size over a chick-rearing period
    flight to assess productivity. Total activity at Malheur/Mud Lake by American white
    pelicans: counts of pelicans at colony, loafing areas, foraging areas. Establish
    photo archive of important nesting, loafing, and foraging habitat for all three
    species.Flyway-based Objectives: contribute to flyway monitoring of Caspian terns
    and double-crested cormorants, particularly during period of intensive management
    of both species in Columbia Basin.Quantify colony size (nest counts) of Caspian
    terns and double-crested cormorants.Detect any large (> 250 individuals) aggregations
    (nesting, loafing, or foraging) of double-crested cormorants immigrating into system.",nt"license_title":
